import React, { Component } from 'react'

class LoginForm extends Component {

    render(){
        return(
            <div>
               Log-In Form 
            </div>
            )
    }
}

class LoginSection extends Component {

    render(){
        return(
            <div>
                Below is a log in Form:
               <LoginForm />
            </div>
            )
    }
}

export default LoginSection
